  false,\n\t\"url\": null,\n\t\"notes\": \"Waterfowl nesting conditions on the Innoko
  in 1986 were much improved over the flooding and late spring of 1985. Light snowfall
  in the winter of '85-'86 accumulated only 1-2 feet throughout the Innoko basin.
